import React from 'react';
import { Container, Row, Col, Image, Button } from 'react-bootstrap';
import styled from 'styled-components';
import photosite from './assets/img/visualsbydandre.jpg';
import comparts from './assets/img/choosemyparts.png';
import cryptosite from './assets/img/cryptoupdates.png';
import Footer from '../footer/Footer';

const ProjectList = styled.div`
    padding-top: 7%;
    width: 100%;
    height: 100%;
`;

const Title = styled.h3`
    display: flex;
    justify-content: center;
    text-decoration: underline;
    padding-bottom: 5%;
    font-size: 44px;
`;

const Center = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    padding-bottom: 20px;  
`;

const projectTitle = {
    fontSize: "24px",
    color: "rgb(39, 221, 221)" 
};

const background = {
    backgroundColor: "black",
    color: "white"
};

const End = styled.span`
    display: flex;
    justify-content: center;
    margin: auto;
    width: 90%;
    font-size: 18px;
    font-weight: bold;
    padding-top: 50px;
`;

export default function Test() {
    return (
        <ProjectList>
            <Container>
                <Title>Projects</Title>
                <Center>
                    <Row>
                        <Col md={1}>
                            <Image src={photosite} style={{width:"500px",height:"auto"}} />
                        </Col>
                        <Col md={4}>
                            <p>Yooo</p>
                        </Col>
                    </Row>                    
                </Center>
                <End>Other projects are ...</End>
            </Container>            
        </ProjectList>
    )
}
